;; **
;;; ### Rotate-by
;; **

;; @@
(def img (clone neko))

(def rotation-angle 45)
(def matrix
  (get-rotation-matrix-2-d
    (new-point (/ (.width img) 2) (/ (.height img) 2)) rotation-angle 1))

(warp-affine! img matrix (.size img))
(u/mat-view img)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"82\" height=\"122\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x40ba3b1f \"BufferedImage@40ba3b1f: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@43b61642 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 82 height = 122 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(defn rotate-by! [img angle]
  (let [M2 (get-rotation-matrix-2-d  (new-point (/ (.width img) 2) (/ (.height img) 2)) angle 1)]
    (warp-affine! img M2 (.size img))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;dry-spring/rotate-by!</span>","value":"#'dry-spring/rotate-by!"}
;; <=

;; @@
(->> (range 0 360 40)
     (map #(-> neko clone (rotate-by! % )))
     (hconcat!)
     (u/mat-view))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"738\" height=\"122\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7a607f02 \"BufferedImage@7a607f02: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@43b61642 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 738 height = 122 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(defn rotate-by! 
  ([img angle] (rotate-by! img angle 1))
  ([img angle zoom]
   (let 
     [M2 (get-rotation-matrix-2-d (new-point (/ (.width img) 2) (/ (.height img) 2)) angle zoom)]
    (warp-affine! img M2 (.size img)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;dry-spring/rotate-by!</span>","value":"#'dry-spring/rotate-by!"}
