(def m1 (new-mat 5 5 CV_8UC1))
(set-to m1 (new-scalar 128 0 0))
(.dump m1)

(-> (new-mat 50 50 CV_8UC1)
    (set-to (new-scalar 128 0 0))
    (u/mat-view))

(-> m1 clone
  (rotate-by! 45)
  (.dump))

(-> (new-mat 50 50 CV_8UC1)
    (set-to (new-scalar 128 0 0))
    (rotate-by! 45)
    (u/mat-view))
