(def src
  (u/matrix-to-matofpoint2f [[0 0] 
                             [5 5] 
                             [4 6]]))
(def dst
  (u/matrix-to-matofpoint2f [[2 0] 
                             [5 5] 
                             [4 6]]))

(def transform-mat (get-affine-transform src dst))
(.dump transform-mat)

(-> neko clone (warp-affine! transform-mat (.size neko)) u/mat-view)
